import React, {Component} from 'react';

class Sketch extends Component{
    constructor(props)
    {
        super(props);
        this.state = {
            userName: "Sagnik" 
        }
    }

    render()
    {
        return (
            <div style={{
                background: "rgba(0,0,0,0.5)",
                display: "flex",
                // height: '100vh',
                // width: '100vw',
            }}>
                <div style={{
                    background: "#fff"
                }}>
                    hello
                </div>
            </div>
        );
    }
}

export default Sketch;
